Structures are a collection of fields of storing complex data structures. struct = "struct" identifier [ generics ] "{" [ struct_fields ] "}"
struct_fields = struct_field "," struct_field
struct_field = identifier [ "?" ] ":" type Examples: struct Pet { name: String, age?: Integer
} struct Complex { r: Float, i: Float
} struct Person { first_name: String (length=1..50)
}` struct PaginatedResponse<T> { results: T, page: Integer(range=0..), count: Integer(range=0..),
}

21.body:
By appending a ? to the field identifier a field is marked as optional. Optional means that the field can be absent from the structure. There also exists the special Nullable<T> type which is used for something completely different. While optional means that the field can be missing from the serialized structure Nullable<T> means that instead of T a special Null value can be transferred instead. It is perfectly valid to use optional and nullable at the same time: struct UpdateProfile { name?: String, age?: Nullable<Integer>,
} Both name and age are optional in this example. Since Strings do have a special empty value (the empty string: "") it does not need to be Nullable. Integers on the other hand do not have such thing so Nullable<Integer> would make it possilbe to clear the age of a user profile. A JSON serialized structure containing an empty string for the name and Null for the age would look like this: { "name": "", "age": null,
} Some programming languages and serialization formats support this quite naturaly. JavaScript and JSON differenciate between undefined and null for object attributes. For languages that don't support this out of the box optional fields and nullable types are put in a special wrapper.

23.body:
Enumerations in webwire fulfill two things. They can either be used as plain enumerations like in most programming languages. An optional type argument makes it possible to describe tagged unions. This is especially handly for returning errors which might contain data which depends on the actual error code. Enumerations can also extend existing enumerations. enum = "enum" identifier [ generics ] [ enum_extends ] "{" enum_variants "}"
enum_extends = "extends" identifier [ generics ]
enum_variants = [ enum_variant { "," enum_variant } [ "," ] ]
enum_variant = identifier [ "(" type ")" ] Examples: enum Status { Enabled, Disabled, Error
} enum AuthError { Unauthenticated, PermissionDenied
} enum GetError extends AuthError { DoesNotExist
} enum Notification { UserJoined(User), UserLeft(User), Message(ChatMessage),
}

